import { makeStyles } from '@mui/styles';
import React from 'react'


const useStyles = makeStyles(() => ({
  carrusel: {
        height: "50%",
        display: "flex",
        alignItems:"center",
  },
}));


const Carrusel = () => {
    const classes = useStyles();


    return (
        <div className={classes.carrusel}>Carrusel</div>
    )
}

export default Carrusel
